CREATE TABLE user(
id INT NOT NULL AUTO_INCREMENT,
fname varchar(30),
lname varchar(30),
mail varchar(50),
status BIT,
PRIMARY KEY (`id`)
);



CREATE TABLE IF NOT EXISTS `location` (
  `id` bigint(15) unsigned NOT NULL DEFAULT '0',
  `related_id` bigint(15) unsigned NOT NULL DEFAULT '0',
  `real_location_id` bigint(15) unsigned DEFAULT '0',
  `locationName` varchar(50) NOT NULL DEFAULT '',
  `locCityName` varchar(30) DEFAULT NULL COMMENT 'location nın şehir adı',
  `locDistrictName` varchar(30) DEFAULT NULL COMMENT 'location ilçe adı',
  `locCountyName` varchar(30) DEFAULT NULL,
  `_index` int(4) NOT NULL DEFAULT '0',
  `mainIndex` int(4) NOT NULL DEFAULT '0',
  `active` int(2) NOT NULL DEFAULT '0',
  `_level` int(4) NOT NULL DEFAULT '0' COMMENT '0: ülke',
  `subsNumber` int(4) unsigned NOT NULL DEFAULT '0',
  `locationDesc` text,
  `keyword` varchar(255) DEFAULT NULL,
  `isUnknown` tinyint(1) unsigned DEFAULT '0',
  `sort` tinyint(4) DEFAULT '20' COMMENT 'sıralama için normal şehirler 20, özel şehirler 1 den başlar',
  `locationAlias` varchar(20) DEFAULT NULL,
  UNIQUE KEY `id` (`id`),
  KEY `_level` (`_level`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AVG_ROW_LENGTH=128 PACK_KEYS=0 ROW_FORMAT=DYNAMIC;

--
-- Tablo döküm verisi `location`
--




CREATE VIEW view_location_json AS 
SELECT id, related_id,
    if((_level = 2),locationName,locationName) AS locationName,
    _level, sort 
FROM
    location
